new A.kz("main","Dashboard Home","Welcome to your new home system!",A.b(["Welcome to your new home system! This new system will help provide you with a more streamlined experience operating your home.","First, we have the dashboard. Each box in the dashboard is called a \"widget\". The dashboard will tell you the weather at home, the current temperature inside your home, what music is currently playing, who has birthdays today, and my current Dexcom reading. Sometimes, you'll see an Announcements box at the top, indicating new announcements. You might also see alerts, which are typically related to the host's status, like temperature warnings.","The weather widget will tell you the current temperature, what it really feels like, and the wind speed and direction. The temperature widget will tell you stats from the thermostat. We'll go through each little thing here in the Devices tab, as this is a stripped-down version of the thermostat widget in Devices.",'You can also see a box called "Message" and a Send button right beside it. You can type a message in the Message box, and then send that using the Send button. This will broadcast an announcement to the entire house, using the host\'s speakers. It uses text-to-voice to do this.',"Next, the Birthdays box will list everyone registered who has a birthday that day. This list can grow with more and more people's birthdays I learn.",'You\'ll next see a Music widget, which will show you music currently being broadcasted to the host. It will also allow you to pause/play it. Click into it to see advanced options. You can use your own device to broadcast your music to the host, but only Spotify is currently supported.The device will show up as Home Speaker. (Ignore DEBUG: Home Speaker if you see it.) Under this you will see a box like "Dexcom Readings". This will show you my current and previous readings, along with how old the current is. Click into it to see more details.',"Around the house, you might see tablets set up as dashboards. These can be used instead of mobile devices.\n\nThat covers the dashboard home page! As you navigate around the home app, you should see more help dialogues like this one (although they won't be as long)."],r)).mS(0)
new A.kz("devices","Devices","Devices",A.b(["This is the Devices tab. Here, you can control the devices around your house.\n\nFirst, the TVs. You'll see your TVs here. There's a power button right next to them to turn it on or off, and you can also click into them to see a full remote.\n\nTip: If you're on the Devices page and tap \"Devices\" in the navigation bar again, then it will scroll you to the home controls section.","Next is the thermostat widget. You can see the detected temperature, the target temperature, the heating/cooling mode (target on the left, current on the right), the fan status (target on the left, current on the right), and the humidity. You can also see the name, manufacturer, model, version, firmware revision, and serial number. Click into this to change settings like the target heating/cooling mode, the target temperature, the cooling/heating thresholds, and the fan target status.",'The next widget is the Host widget. Here you can control the volume/brightness of the host, the screen, and you can manage the "fireplaces". You can slide the volume bar to control the volume, although it does have a set maximum. You can also press the volume icon next to it to mute/unmute it. You can also slide the brightness bar to control the brightness of the screen.\n\nNext is the fireplace section. Click Fireplace to select a fireplace to turn on, or click Off to stop all fireplaces. Fireplaces are basically cool looping videos you can make the host start playing, with optional ambient sound (using the speaker button in the top right). The fireplace sound and music casting are separate, so you can do both at the same time.\n\nThe bottom part of the Host section is the screen button. Depending on what it is, you can either turn the screen on or off. Turning the screen off does not suspend anything, so it\'s completely fine. Turning the screen on may take a couple seconds due to some workarounds I had to use to accomplish it.','The next section is more dynamic, you could say, as there\'s no specific list of controls here. This is the home control section. You\'ll see some small, long widgets that say stuff like "Living Room" that says "X Device(s)". Those "devices" are underneath, each in their own widget. Depending on the type of device, like a light switch, smart plug, or dashboard, it will show different controls.'],r)).mS(0)
new A.kz("calendar",o,o,A.b(["This is the calendar. Here you can view the current calendar from 1 year back to 3 years forward. Each row goes from Sunday to Saturday, and the dots represent events on each section. When no list is selected, the dots' colors match other dots with the same list. When a list is selected, the colors are random. You can click into any of the day boxes to see, manage, or create events.","In the top center is a dropdown, which controls the current selected list. Lists are public and can be seen by anyone else using the home system. You can create new lists when creating a new event."],r)).mS(0)
q=new A.kz("calendar-day","Calendar Day",o,B.cH)
q.d=A.b(["This is placeholder dialogue."],r)
